import React from "react";
import {Helmet} from "react-helmet";
const Utah = () =>{
    return(
        <>
        <Helmet>         
          <title>See Benefits and Resource Guides for Home Warranty Services in Utah</title>
          <meta name="description" content="Acclaimed Home Warranty has provided some of the useful resources for people in Utah looking out for home warranty plans. Contact us today for more."/>
        </Helmet>
         <div className="home_page">
         {/* start inner banner */}
            <section className="top-image">
              <img src="images/UtahHomeowner.png" alt="inner banner"/>
            </section>
            {/* end inner banner */}
         </div>
        </>
    ) 
};
export default Utah;
